import React from 'react';
import {Card, CardActions, CardActionsArea, CardContent, CardMedia, Button, Typography} from '@material-ui/core';

//this is the file that will show the data for a specific article

const NewsCard = ({article: {description, publishedAt, source, title, url, urlToImage}, i}) => {
    return (
        <Card>
            <CardActionsArea>
                <CardMedia image={urlToImage || 'https://as2.ftcdn.net/jpg/03/29/24/37/500_F_329243708_oXkPklGDS1BMjtwrWrxepInCGbjag0DL.jpg'} />
                <div>
                    <Typography variant="body2" color="textSecondary" component = "h2">{(new Date(publishedAt)).toDateString()}</Typography>
                    <Typography variant="body2" color="textSecondary" component = "h2">{source.name}</Typography>
                </div>
                <Typography gutterBottom variant="h5"></Typography>
                <CardContent>
                    <Typography variant="body2" color="textSecondary" component = "p"></Typography>
                </CardContent>
            </CardActionsArea>
            <CardActions>
                <Button size="small" color="primary"></Button>
                <Typography variant="h5" color="textSecondary"></Typography>
            </CardActions>
        </Card>
    )
}

export default NewsCard;
